   314→        <h1 id="firstHeading">Semantic Hygiene</h1>
   315→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   316→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Linguistic_prescription">linguistic prescription</a> or <a href="/wiki/Plain_language">plain language</a> movements.</i></div>
